export const add = (quote) => {
  return {
    type: "ADD_QUOTE",
    quote: Object.assign({}, quote, { votes: 0 }),
  };
};

export const getVideos = () => {
  return (dispatch) => {
    fetch("http://localhost:3000/movies")
      .then((resp) => resp.json())
      .then((videos) => {
        dispatch({
          type: "SET_VIDEOS",
          payload: {
            videos: videos,
          },
        });
      });
  };
};
